import bcrypt from "bcryptjs";

import jsPDF from "jspdf";
import {
  collection,
  doc,
  getDoc,
  getDocs,
  query,
  setDoc,
  where,
} from "firebase/firestore";
import { db } from "./firebase";

// Função de login com Firestore
export async function loginUser({
  phone,
  password,
}: {
  phone: string;
  password: string;
}) {
  const q = query(collection(db, "customers"), where("phone", "==", phone));
  const querySnapshot = await getDocs(q);

  if (!querySnapshot.empty) {
    const userDoc = querySnapshot.docs[0];
    const userData = userDoc.data();
    const passwordMatch = await bcrypt.compare(password, userData.password);
    if (passwordMatch) {
      return { id: userDoc.id, ...userData };
    } else {
      throw new Error(
        "A palavra-passe ou número de telefone estão incorretos."
      );
    }
  } else {
    throw new Error("Nenhum usuário com essas credenciais foi encontrado!");
  }
}

export async function createCustomer(
  name: string,
  address: string,
  phone: string,
  password: string,
  acceptedTerms: boolean // Add this parameter
) {
  const customerRef = doc(collection(db, "customers"), phone);
  const customerSnap = await getDoc(customerRef);

  if (customerSnap.exists()) {
    throw new Error("Usuário já existe");
  }

  const hashedPassword = await bcrypt.hash(password, 10);

  const customerData = {
    name,
    address,
    phone,
    password: hashedPassword,
    acceptedTerms,
    createdAt: new Date().toISOString(),
  };

  await setDoc(customerRef, customerData);

  return { id: customerRef.id, ...customerData }; // Return the created customer
}

export const gerarFaturaPDF = (user, order) => {
  const doc = new jsPDF();

  console.log(order);
  

  // Logo em base64 (exemplo com ícone do React)
  const logoBase64 =
    "data:image/jpeg;base64,"; // TROQUE pelo seu

  // Adiciona o logo
  doc.addImage(logoBase64, "PNG", 15, 10, 30, 30);

  // Nome da loja
  doc.setFontSize(18);
  doc.setTextColor(40, 70, 40);
  doc.text("Casa Catarina Dembi", 105, 20, { align: "center" });

  // Dados do cliente
  doc.setFontSize(12);
  doc.setTextColor(0);
  doc.text(`Nome: ${user.name}`, 15, 50);
  doc.text(`Telefone: +244 ${user.phone}`, 15, 58);
  doc.text(`Endereço: ${user.address}`, 15, 66);
  doc.text(`Data: ${new Date().toLocaleDateString()}`, 15, 74);

  // Título da fatura
  doc.setFontSize(14);
  doc.setTextColor(0);
  doc.text("Detalhes da Fatura", 15, 90);

  // Tabela de produtos
  const startY = 100;
  doc.setFontSize(12);
  doc.setFillColor(220, 220, 220); // cinza claro
  doc.rect(15, startY, 180, 10, "F"); // header
  doc.setTextColor(0);
  doc.text("Produto", 20, startY + 7);
  doc.text("Qtd", 100, startY + 7);
  doc.text("Preço (Kz)", 140, startY + 7);


  
  let y = startY + 15;
  let total = 0;



  order.forEach((p) => {
    doc.text(p.name, 20, y);
    doc.text(String(p.quantity), 100, y);
    doc.text(`Kz ${p.price}`, 140, y);
    total += p.quantity * p.price;
    y += 10;
  });

  // Total
  doc.setFontSize(12);
  doc.setFont("helvetica", "bold");
  doc.text(`Total: Kz ${total}`, 140, y + 5);

  // Rodapé
  doc.setFontSize(11);
  doc.setFont("helvetica", "normal");
  doc.text("Obrigado por comprar connosco!", 15, y + 20);

  doc.save("fatura_profissional.pdf");
};
